import React, { Component } from 'react';
import './LiangDian.css'

class LiangDian extends Component {
	render(){
		return (
			<div className='f1 tc'>
				<h1>Hello, I am LiangDian and I am very cute!</h1>
				<p>I love to chill</p>
			</div>
		)
	}
}

export default LiangDian;
